def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    indexer = np.concatenate([blk.mgr_locs for blk in data.blocks])

    is_nullable_integer = all(
        data.blocks[i].is_extension for i in range(len(data.blocks))
    )

    if is_nullable_integer:
        # If the data is nullable int, convert it to float for mean calculation
        new_values = np.array([data.blocks[i].values.astype(float) for i in range(len(data.blocks))])
    else:
        new_values = np.array([data.blocks[i].values for i in range(len(data.blocks))])

    result_values, _ = self.grouper.aggregate(new_values, how, axis=1, min_count=min_count)

    for i, block in enumerate(data.blocks):
        new_block = block.make_block(result_values[i])
        agg_blocks.append(new_block)

    agg_items = data.items
    return agg_blocks, agg_items
